/* define a handler for connection events */
void lua_conn_handler(xmpp_conn_t * const conn, const xmpp_conn_event_t status, 
		  const int error, xmpp_stream_error_t * const stream_error,
		  void * const userdata)
{
	handler_info* chi = (handler_info*)userdata;
	lua_pushlightuserdata(chi->L, (void*)userdata);
	lua_gettable(chi->L, LUA_REGISTRYINDEX);
	if(lua_isnil(chi->L, -1)) fprintf(stderr, "Internal error!");
	lua_getfield(chi->L, -1, "callback");
	lua_newtable(chi->L);
	SWIG_NewPointerObj(chi->L,conn,SWIGTYPE_p__xmpp_conn_t,0);
	lua_setfield(chi->L, -2, "conn");
	lua_pushinteger(chi->L, (int)status);
	lua_setfield(chi->L, -2, "status");
	lua_pushinteger(chi->L, error);
	lua_setfield(chi->L, -2, "error");
	SWIG_NewPointerObj(chi->L,stream_error,SWIGTYPE_p_xmpp_stream_error_t,0);
	lua_setfield(chi->L, -2, "stream_error");
	lua_getfield(chi->L, -3, "data");
	if(lua_pcall(chi->L, 2, 0, 0))
	{
		printf("*** Error in connection handler: %s\n", lua_tostring(chi->L, -1));
		lua_pop(chi->L, 1);
	}
}

